id = "PAV221"
question = "Vad visar forskningen om kursplanens påverkan på undervisning och lärande?"
answer = "Forskningen pekar på att det som kursplanen lägger vikt vid är det som får mer utrymme eller uppmärksamhet i läromedel och undervisning; elevernas kunskaper är också starkast i dessa delar"
