[[questions]]
id = "PAV262"
question = "Vad lyfter Chamot och O'Malley fram som svårigheter för andraspråkselever i matematikundervisningen?"
answer = "Där refereras till Chamot och O'Malley (1987) och Ron (1999) vilka lyfter fram de svårigheter andraspråkselever har med det språk som förekommer i matematikundervisningen, i synnerhet de svårigheter som i text formulerade matematikuppgifter utgör"
